s\n#\"\"\" (Doc Strings)\n#| (Data Tables)\n#@ (Tags/Labels):To group Scenarios\n#<> (placeholder)\n#\"\"\n## (Comments)\n#Sample Feature Definition Template\n@register\nFeature: Validate Register page\n  @register_01\n  Scenario: launch to Homepage\n   \tGiven The user opens DS Algo portal link\n    When User Click on \"Get Started\"\n    Then Home Page Title should be \"NumpyNinja\" \n  #Scenario: User is on Homepage and click on Register\n    Given User is on Homepage\n    When The user clicks on register link\n    Then The user redirected to Registration page\n # @register_02\n  #Scenario: The user is presented with error message for empty fields below Username textbox\n   # Given The user opens Register Page\n   # When The user clicks \"Register\" button with all fields empty\n   # Then It should display an error message \"Please fill out this field.\" below Username textbox\n   @register_03\n  Scenario: The user is presented with error message for empty fields below Password textbox\n    Given The user opens Register Page\n    When The user clicks \"Register\" button after entering username with other fields empty\n      | username       |\n      | testing123 |\n    Then It should display an error message \"Please fill out this field.\" below Password textbox\n   @register_04\n  Scenario: The user is presented with error message for empty fields below confirm Password textbox\n    Given The user opens Register Page\n    When The user clicks \"Register\" button after entering \"username\" and \"password\" with Password Confirmation field empty\n      | username       | password     |\n      | testuser123 | testpassword |\n    Then It should display an error message \"Please fill out this field.\" below Password Confirmation textbox\n    @register_05\n  Scenario: The user is presented with error message for invalid username\n    Given The user opens Register Page\n    When The user enters a \"username\" with characters other than Letters, digits and \"@/./+/-/_\"\n      | username | password     | password confirmation |\n      | &**&**&  | testpassword | testpassword          |\n    Then It should display an error message \"password_mismatch:The two password fields didnt match.\"\n     @register_06\n  Scenario: The user is presented with error message for password mismatch\n    Given The user opens Register Page\n    When The user clicks \"Register\" button after entering valid \"username\" and different passwords in \"password\" and \"password confirmation\" fields\n      | username       | password     | password confirmation |\n      | winterchamps | testpassword | testpassword1         |\n    Then It should display an error message \"password_mismatch:The two password fields didnt match.\"\n    @register_07\n  Scenario: The user redirected to Homepage with valid details\n    Given The user opens Register Page\n    When The user enters a valid \"username\" and \"password\" and \"password confirmation\"\n      | username       | password  | password confirmation |\n      | winterchamps12 | Testwinter1! |  Testwinter1! |\n    Then The user should be redirected to Homepage with the message \"New Account Created. You are logged in as <username>\"\n  #   @register_08\n  #Scenario Outline: User on signin page and login with valid credentials\n  #  Given The user is on signin page\n   # When The user enter valid \"<username>\" and \"<password>\"\n    #Then click login button to verify\n\n    #Examples: \n     # | username       | password  |\n      #| winterchamps | Testwinter1! |","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/shrav/eclipse-workspace/Dsalgo_cucumber1/src/test/resources/AppFeatures/3_Register.feature","feature":{"location":{"line":20,"column":1},"tags":[{"location":{"line":19,"column":1},"name":"@register","id":"863925ad-8c78-4865-b724-f5391fe4d833"}],"language":"en","keyword":"Feature","name":"Validate Register page","description":"","children":[{"scenario":{"locati Doc Strings)\n#| (Data Tables)\n#@ (Tags/Labels):To group Scenarios\n#<> (placeholder)\n#\"\"\n## (Comments)\n#Sample Feature Definition Template\n#@data_structure\nFeature: User launch dsalgo application and test Data Structure introduction page\n\tBackground: The user is logged in to DS Algo portal\n    Given The user is on Signin page of DS Algo portal\n    When The user enter valid \"winterchamps\" and \"Testwinter1!\"\n    And The user click on login button\n    Then The user logged in successfully\n    \n\t@DS_01\n  Scenario: The user is able to navigate to Data Structure introduction page\n    Given The user is on the \"home page\" after logged in\n    When The user clicks the \"Getting Started\" button in Data Structure Page introduction Panel\n    Then The user be directed to \"Data Structures-Introduction\" page\n       \n\t@DS_02\n  Scenario: The user is able to navigate to Time Complexity page\n    Given The user is on the \"Data Structures Introduction\" after logged in\n    When The user clicks Time Complexity link\n    Then The user is redirected to \"Time Complexity\" page\n  @DS_03\n  Scenario: The user is able to navigate to a page having an tryEditor from Time Complexity page\n    Given The user is on the \"Time Complexity\" after logged in\n    When The user clicks Try Here button\n    Then The user should be redirected to a page having an tryEditor with a Run button to test\n  @DS_04\n  Scenario Outline: The user is able run code in tryEditor for Time Complexity page\n    Given The user is in a page having an tryEditor with a Run button to test\n    When The user enter valid python code in tryEditor from sheet \"<SheetName>\" and <RowNumber>\n    And The user clicks on run button\n    Then The user should be presented with Run result\n\n    Examples: \n      | SheetName  | RowNumber |\n      |pythonCode|0|\n      \n   @DS_05\n  Scenario Outline: The user is presented with error message for code with invalid syntax in tryEditor for Time Complexity page\n    Given The user is in a page having an tryEditor with a Run button to test\n    When The user enter python code with invalid syntax in tryEditor from sheet \"<Sheetname>\" and <RowNumber>\n    And The user clicks on run button\n    Then The user should be presented with error message\n\n    Examples: \n      | Sheetname  | RowNumber |\n      | pythonCode |         1 |\n    \n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/shrav/eclipse-workspace/Dsalgo_cucumber1/src/test/resources/AppFeatures/6_DataStructure.feature","feature":{"location":{"line":20,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"User launch dsalgo application and test Data Structure introduction page","description":"","children":[{"background":{"location":{"line":21,"column":2},"keyword":"Background","name":"The user is logged in to DS Algo portal","description":"","steps":[{"location":{"line":22,"column":5},"keyword":"Given ","keywordType":"Context","text":"The user is on Signin page of DS Algo portal","id":"e7712e92-e8fe-405b-97da-04597e2c347b"},{"location":{"line":23,"column":5},"keyword":"When ","keywordType":"Action","text":"The user enter valid \"winterchamps\" and \"Testwinter1!\"","id":"562fd051-d91d-460a-816c-63dd02a1a25f"},{"location":{"line":24,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"The user click on login button","id":"767d9c77-d4c4-4a36-b6b4-4c45a55755a5"},{"location":{"line":25,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"The user logged in successfully","id":"59b2abfd-4672-484e-b5e1-67ee02fc5240"}],"id":"ea70d6a3-a173-4ba6-b8b9-746cf245ead4"}},{"scenario":{"location":{"line":28,"column":3},"tags":[{"location":{"line":27,"column":2},"name":"@DS_01","id":"22727873-38db-41b4-a8a8-7d6538c573c1"}],"keyword":"Scenario","name":"The user is able to navigate to Data Structure introduction page","description":"","steps":[{"location":{"line":29,"column":5},"keyword":"Given ","keyw ef6b4603d80","timestamp":{"seconds":1705704306,"nanos":931585600},"willBeRetried":false}},{"source":{"uri":"file:///C:/Users/shrav/eclipse-workspace/Dsalgo_cucumber1/src/test/resources/AppFeatures/7_Stack.feature","data":"#Author: your.email@your.domain.com\n#Keywords Summary :\n#Feature: List of scenarios.\n#Scenario: Business rule through list of steps with arguments.\n#Given: Some precondition step\n#When: Some key actions\n#Then: To observe outcomes or validation\n#And,But: To enumerate more Given,When,Then steps\n#Scenario Outline: List of steps for data-driven as an Examples and <placeholder>\n#Examples: Container for s table\n#Background: List of steps run before each of the scenarios\n#\"\"\" (Doc Strings)\n#| (Data Tables)\n#@ (Tags/Labels):To group Scenarios\n#<> (placeholder)\n#\"\"\n## (Comments)\n#Sample Feature Definition Template\n@stack\nFeature: User tests the stack page on the Ds algo application\n\n  Background: The user is logged in to DS Algo portal\n    Given The user is on Signin page of DS Algo portal\n    When The user enter valid \"winterchamps\" and \"Testwinter1!\"\n    And The user click on login button\n    Then The user redirected to homepage\n\n  @stack_02\n  Scenario: The user is directed to \"Stack\" Page\n    Given The user is on the \"home page\" after logged in\n    When The user selects Stack item from the drop down menu\n    Then The user should be directed to \"Stack\" Page\n  @stack_03\n  Scenario: The user is able to navigate to \"Operations in Stack\" page\n    Given The user is on the \"Stack page\" after logged in\n    When The user clicks on the Operations in Stack link\n    Then The user should then be directed to \"Operations in Stack\" Page\n  @stack_04\n  Scenario: The user is able to navigate to a page having an tryEditor from Operations in Stack page\n    Given The user is on the \"Operations in Stack page\" after logged in\n    When The user clicks \"Try Here\" button in \"stack\" page\n    Then The user should be redirected to a page having an tryEditor with a Run button to test\n   @stack_05\n  Scenario Outline: The user is able to run code in tryEditor for Operations in Stack page\n    Given The user is in stack page having an tryEditor with a Run button to test\n    When The user gets input from sheet \"<Sheetname>\" and <RowNumber>\n    And The user clicks on Run button after Entering valid python code in stack tryEditor\n    Then The user should be presented with Run output\n\n    Examples: \n      | Sheetname  | RowNumber |\n      | pythonCode |         0 |\n\n  @stack_06\n  Scenario Outline: The user is able to get the error message for invalid syntax for Operations in Stack page\n    Given The user is in stack page having an tryEditor with a Run button to test\n    When The user gets invalid input from sheet \"<Sheetname>\" and <RowNumber>\n    And The user clicks on Run button after Entering invalid python code in stack tryEditor\n    Then The user should be presented with error output\n\n    Examples: \n      | Sheetname  | RowNumber |\n      | pythonCode |         1 |\n   @stack_07\n  Scenario: The user is able to navigate to \"Implementation\" Page\n    Given The user is on the \"Stack page\" after logged in\n    When The user clicks on the Implementation button\n    Then The user should be directed to Implementation Page\n   @stack_08\n  Scenario: The user is able to navigate to Implementation page having an tryEditor \n    Given The user is on the \"Stack Implementation page\" after logged in\n    When The user clicks \"Try Here\" button in \"stack Implementation\" page\n    Then The user should be redirected to a page having an tryEditor with a Run button to test\n   @stack_09\n  Scenario Outline: The user is able to run code in tryEditor for stack Implementation page\n    Given The user is in stack page having an tryEditor with a Run button to test\n    When The user gets input from sheet \"<Sheetname>\" and <RowNumber>\n    And The user clicks on Run button after Entering valid python code in stack tryEditor\n    Then The user should be presented with Run output\n\n    Examples: \n      | Sheetname  | RowNumber |\n      | pythonCode |         0 |\n\n  @stack_10\n  Scenario Outline: The user is able to get the error message for invalid syntax for stack Implementation page\n    Given The user is in stack page having an tryEditor with a Run button to test\n    When The user gets invalid input from sheet \"<Sheetname>\" and <RowNumber>\n    And The user clicks on Run button after Entering invalid python code in stack tryEditor\n    Then The user should be presented with error output\n\n    Examples: \n      | Sheetname  | RowNumber |\n      | pythonCode |         1 |\n   @stack_11\n  Scenario: The user is able to navigate to \"Applications\" in stack Page\n    Given The user is on the \"Stackpage\" after logged in\n    When The user clicks on the Applications button\n    Then The user should be directed to Applications Page\n   @stack_12\n  Scenario: The user is able to navigate to Applications page having an tryEditor\n    Given The user is on the \"Application stack page\" after logged in\n    When The user clicks \"Try Here\" button in \"stack Applications\" page\n    Then The user should be redirected to a page having an tryEditor with a Run button to test\n   @stack_13\n  Scenario Outline: The user is able to run code in tryEditor for stack Applications page\n    Given The user is in stack page having an tryEditor with a Run button to test\n    When The user gets input from sheet \"<Sheetname>\" and <RowNumber>\n    And The user clicks on Run button after Entering valid python code in stack tryEditor\n    Then The user should be presented with Run output\n\n    Examples: \n      | Sheetname  | RowNumber |\n      | pythonCode |         0 |\n\n  @stack_14\n  Scenario Outline: The user is able to get the error messagefor invalid syntax for stack Applications page\n    Given The user is in stack page having an tryEditor with a Run button to test\n    When The user gets invalid input from sheet \"<Sheetname>\" and <RowNumber>\n    And The user clicks on Run button after Entering invalid python code in stack tryEditor\n    Then The user should be presented with error output\n\n    Examples: \n      | Sheetname  | RowNumber |\n      | pythonCode |         1 |\n\n  @stack_15\n  Scenario: The user is able to navigate to \"Practice Questions\" in stack Page\n    Given The user is on the \"Stack page\" after logged in\n    When The user clicks on the Practice Questions button\n    Then The user should be directed to Practice Questions  Page","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/shrav/eclipse-workspace/Dsalgo_cucumber1/src/test/resources/AppFeatures/7_Stack.feature","feature":{"location":{"line":20,"column":1},"tags":[{"location":{"line":19,"column":1},"name":"@stack","id":"66d01b2c-06f1-4b2f-b3a4-7866d9e15561"}],"language":"en","keyword":"Feature","name":"User tests the stack page on the Ds algo application","description":"","children":[{"background":{"location":{"line":22,"column":3},"keyword":"Background","name":"The user is logged in to DS Algo portal","description":"","steps":[{"location":{"line":23,"column":5},"keyword":"Given ","keywordType":"Context","text":"The user is on Signin page of DS Algo portal","id":"80d85598-1b58-4c93-a094-6d938f21b976"},{"location":{"line":24,"column":5},"keyword":"When ","keywordType":"Action","text":"The user enter valid \"winterchamps\" and \"Testwinter1!\"","id":"9f3ffa3a-b800-4070-92ee-c06b5f2417ba"},{"location":{"line":25,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"The user click on login button","id":"e464d319-85c6-4b7d-b197-2fc3225f40a4"},{"location":{"line":26,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"The user redirected to homepage","id":"941fa9a8-b08d-4f5e-befd-592cdc05d3a3"}],"id":"fc66717b-26ec-49da-a749-ad31d48ac25a"}},{"scenario":{"location":{"lin itor from Overview of Trees page\n    Given The user is on the \"overview of trees\" after logged in\n    When The user clicks \"Try Here\" button in a \"tree\" page\n    Then The user should be redirected to a page having tryEditor with a Run button to test\n   @tree_05\n  Scenario Outline: The user is able to run code in tryEditor for Overview of Trees page\n    Given The user is in trees page having an tryEditor with a Run button to test\n    When The user gets input from sheet \"<Sheetname>\" and <RowNumber> in trees\n    And The user clicks on Run button after Entering valid python code in trees tryEditor\n    Then The user should be presented with Run output for trees\n\n    Examples: \n      | Sheetname  | RowNumber |\n      | pythonCode |         0 |\n   @tree_06\n  Scenario Outline: The user is able to get the error message for invalid syantax for Overview of Trees page\n    Given The user is in trees page having an tryEditor with a Run button to test\n    When The user gets invalid input from sheet \"<Sheetname>\" and <RowNumber> in trees\n    And The user clicks on Run button after Entering invalid python code in trees tryEditor\n    Then The user should get the error message for trees\n\n    Examples: \n      | Sheetname  | RowNumber |\n      | pythonCode |         1 |\n  @tree_07\n  Scenario: The user is able to navigate to \"Terminologies\" Page\n    Given The user is on the \"Tree page\" after logged in\n    When The user clicks on the Terminologies button\n    Then The user should be directed to the \"Terminologies\" of tree Page\n  @tree_08\n  Scenario: The user is able to navigate to Terminologies page having an tryEditor\n    Given The user is on the \"terminologies page\" after logged in\n    When The user clicks \"Try Here\" button in a \"Terminologies\" page\n    Then The user should be redirected to a page having an tryEditor with a Run button to test\n  @tree_09\n  Scenario Outline: The user is able to run code in tryEditor for Terminologies
